import React from "react";
import data from "./data";
import Location from "./Location";
import "./Main.css";

function Main(){
    return (
        <main>
            {
                data.maps( location => {
                    return <Location 
                        key={location.id}
                        location={location}
                    />
                })
            }
        
        </main>
    )
}

export default Main;
